import { Injectable } from '@angular/core';
import * as jsPDF from 'jspdf';
import { DOCUMENT } from '@angular/platform-browser';
import { toBase64String } from '@angular/compiler/src/output/source_map';

@Injectable({
  providedIn: 'root'
})
export class PdfService {

  doc: jsPDF = new jsPDF();
  imageHeader: string = 'data:image/jpeg;base64,';
  constructor() {
  }

  public pdf(pdfData: object, fileName: string): void {
    this.doc.text(pdfData["demoText"], 10, 10);
    console.log(pdfData["demoText"])
    this.doc.addImage(this.imageHeader, 'JPEG', 15, 40, 180, 160);
    this.doc.save(fileName);
  }
}
